import React,{Component} from "react";
import { LineChart, Line, CartesianGrid, XAxis, YAxis } from 'recharts';
import {Div0,DataDrawItem} from'./sty';
const data = [{name: 'Page A', uv: 400, pv: 2400, amt: 2400},{name: 'Page A', uv: 300, pv: 2400, amt: 2400}];
class DataDrawList extends Component{
    render(){
        return (
                <Div0>
                    <DataDrawItem>
                    <LineChart width={320} height={200} data={data}>
                        <Line type="monotone" dataKey="uv" stroke="#8884d8" />
                        <CartesianGrid stroke="#ccc" />
                        <XAxis dataKey="name" />
                        <YAxis />
                    </LineChart>
                    </DataDrawItem>
                    <DataDrawItem></DataDrawItem>
                    <DataDrawItem></DataDrawItem>
                </Div0>
        )}}
export default DataDrawList;
